import React from "react";
import './App.css';
import Header from './component/Header';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./component/Home";
import Footer from "./component/Footer";
function App() {
  return (
    <Router>
      <div className="app">
        <Switch>

        <Route path="/register">
          <h1>This is Re</h1>
          </Route>

          <Route path="/">
            <Header />
            <Home/>
            <Footer/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
